import React from "react";
import PhoneInput from "react-phone-input-2";
import "react-phone-input-2/lib/style.css";
import UserInput from "../../forms/UserData/UserInput";
import AddressForm from "../../forms/UserData/AddressForm";

const UserAdressBlock = ({ setVisible }) => {
  return (
    <form className="address-container">
      <AddressForm label={"Lastname"} />
      <AddressForm label={"Name"} />
      <AddressForm label={"Surname"} />
      <AddressForm label={"Post index"} />
      <AddressForm label={"Region"} />
      <AddressForm label={"Street"} />
      <AddressForm label={"City/Town"} />
      <div className="phone">
        <label>Phone number</label>
        <PhoneInput country={"ua"} />
      </div>
      <AddressForm label={"City/Town"} type={"email"} />
      <div className="btns">
        <button type="button" onClick={setVisible}>
          Cancel
        </button>
        <button type="submit">Sumbit</button>
      </div>
    </form>
  );
};

export default UserAdressBlock;
